 To read network packets from a socket on port 888, you can use the following C++ code:
```cpp
#include <iostream>
#include <string>
#include <arpa/inet.h>
#include <sys/socket.h>
#include <netinet/in.h>

using namespace std;

int main() {
    // Create a socket
    int sock = socket(AF_INET, SOCK_STREAM, 0);

    // Connect to the server on port 888
    struct sockaddr_in serv_addr;
    memset(&serv_addr, 0, sizeof(serv_addr));
    serv_addr.sin_family = AF_INET;
    serv_addr.sin_port = htons(888);
    inet_pton(AF_INET, "127.0.0.1", &serv_addr.sin_addr);
    connect(sock, (struct sockaddr*) &serv_addr, sizeof(serv_addr));

    // Here you can start reading network packets
    char buffer[1024];
    ssize_t n;

    while ((n = recv(sock, buffer, sizeof(buffer), MSG_WAITALL)) > 0) {
        // Do something with the received packet
        cout << "Received packet: " << n << " bytes" << endl;
        cout << "Data: " << buffer << endl;
    }

    // Close the socket
    close(sock);
    cout << "Done" << endl;
}
```
